import React from 'react';
import './CardButton.css';

const CardButton = ({ title, icon, onClick }) => {
  return (
    <div className="card-button" onClick={onClick}>
      {icon && <img src={icon} alt={title} className="card-icon" />}
      <span>{title}</span>
    </div>
  );
};

export default CardButton;
